Superman: The Man of Steel #34
The battle for Metropolis continues between Team Luthor, Cadmus and Metropolis S.C.U. Lois gets new information on Luthor, which she hopes to use to clear her name. With things falling apart, Lex starts blowing up building in Metropolis.

Superman: The Man of Steel #35
One of Luthor's remaining weapons goes on a killing spree, murdering Myra. Fred Bentson finds he is a bridge to another dimension.

